A typical Pandas script consists of multiple data transformations that are executed sequentially. However, in Polars these transformations can be executed in parallel using expressions. Column assignment We have a dataframe df with a column called value. We want to add two new columns, a column called tenXValue where the value column is multiplied by 10 and a column called hundredXValue where the value column is multiplied by 100. In Pandas this would be: df["tenXValue"] = df["value"] * 10
df["hundredXValue"] = df["value"] * 100 These column assignments are executed sequentially. In Polars we add columns to df using the .with_column method and name them with the .alias method: df.with_columns([ (pl.col("value") * 10).alias("tenXValue"), (pl.col("value") * 100).alias("hundredXValue"),
]) These column assignments are executed in parallel. Column assignment based on predicate In this case we have a dataframe df with columns a,b and c. We want to re-assign the values in column a based on a condition. When the value in column c is equal to 2 then we replace the value in a with the value in b. In Pandas this would be: df.loc[df["c"] == 2, "a"] = df.loc[df["c"] == 2, "b"] while in Polars this would be: df.with_column( pl.when(pl.col("c") == 2) .then(pl.col("b")) .otherwise(pl.col("a")).alias("a")
) The Polars way is pure in that the original DataFrame is not modified. The mask is also not computed twice as in Pandas (you could prevent this in Pandas, but that would require setting a temporary variable). Additionally Polars can compute every branch of an if -> then -> otherwise in parallel. This is valuable, when the branches get more expensive to compute. Filtering We want to filter the dataframe df with housing data based on some criteria. In Pandas you filter the dataframe by passing Boolean expressions to the loc method: df.loc[(df['sqft_living'] > 2500) & (df['price'] < 300000)] while in Polars you call the filter method: df.filter( (pl.col("m2_living") > 2500) & (pl.col("price") < 300000)
) The query optimizer in Polars can also detect if you write multiple filters separately and combine them into a single filter in the optimized plan.

