Whereas the Spark DataFrame is analogous to a collection of rows, a Polars DataFrame is closer to a collection of columns. This means that you can combine columns in Polars in ways that are not possible in Spark, because Spark preserves the relationship of the data in each row. Consider this sample dataset: import polars as pl df = pl.DataFrame({ "foo": ["a", "b", "c", "d", "d"], "bar": [1, 2, 3, 4, 5],
}) dfs = spark.createDataFrame( [ ("a", 1), ("b", 2), ("c", 3), ("d", 4), ("d", 5), ], schema=["foo", "bar"],
)
